import React from 'react';
import { Link } from 'react-router-dom';

function Navbar() {

  const redirectToHome=()=>{
    window.location.href="/";
  }

  return (
    <div>
      {/* Top Logo Section */}
      <div className="d-flex justify-content-center align-items-center py-2" style={{ backgroundColor: '#ffe600' }}>
        <span
          className="fw-bold fs-3 px-8 py-2 border border-dark rounded"
          style={{
            letterSpacing: '3px',
            fontFamily: 'monospace',
            color: '#1a1a1a',
            backgroundColor: '#ffffff',
          }}
        >
          WELLCOME TO MEEWOO BANK 
        </span>
      </div>

      {/* Bottom Navigation Section */}
      <nav className="navbar bg-primary px-3" data-bs-theme="dark" style={{ position: 'fixed', top: 0, left: 0, width: '100%', zIndex: 1000 }}>
        <div className="container-fluid">
          <div className="row w-100">
            <div className="col text-center">
              <Link onClick={redirectToHome} className="btn btn-outline-light w-100">Home</Link>
            </div>
            <div className="col text-center">
              <Link to="/customer" className="btn btn-outline-light w-100">Customer Booth</Link>
            </div>
            <div className="col text-center">
              <Link to="/employee" className="btn btn-outline-light w-100">Employee Booth</Link>
            </div>
            <div className="col text-center">
              <Link to="/admin" className="btn btn-outline-light w-100">Admin Booth</Link>
            </div>
          </div>
        </div>
      </nav>
    </div>
  );
}

export default Navbar;
